.myDoc {
    width: 100%;
    padding: 20px;
    .title {
        border-radius: 8px;
        background: #79ac43;
        color: #fff;
        cursor: default;
    }
    .condition {
        display: flex;
        .input {
            width: 80%;
            height: 75px;
            p {
                margin: 0 0 8px 0;
                display: flex;
                .el-input {
                    width: 30%;
                    margin-right: 8px;
                }
            }
        }
        .option {
            flex: 1;
            p {
                display: flex;
                justify-content: center;
                align-items: center;
                i {
                    color: #79ac43;
                    font-size: 20px;
                }
                .el-button {
                    background: #79ac43;
                    color: #fff;
                    border-radius: 8px;
                }
            }
        }
    }
}
